import React, { Component } from 'react';

class CalenderComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            weeks: ['日', '月', '火', '水', '木', '金', '土']
        }
    }
    render() {
        return (
            <div>
                <table>
                    <tr>
                        {this.state.weeks.map(day =>
                            <td key={day}>{day}</td>)}
                    </tr>

                </table>
                <Day />
                {this.props.nowdate.getDate()}
            </div>
        )
    }
}

class Day extends Component {

    render() {
        return (
            <div onClick={this.onClickcom}>tes</div>
        );
    }
    onClickcom() {
        alert("test");
    }
}
export default CalenderComponent;
